    false,nt"url": null,nt"notes": "This dataset represents deposition estimates
    of nutrients within individual local NHDPlusV2 catchments and upstream, contributing
    watersheds based on the National Atmospheric Deposition Program (See Supplementary
    Info for Glossary of Terms). The National Trends Network provides long-term records
    of precipitation chemistry across the United States. Individual rasters describe
    ammonium, nitrate, inorganic nitrogen, and average sulfur/nitrogen deposition per
    year. See Source Info for links to NADP. The nitrogen and sulfur characteristics
    (kg N/ha/yr) were summarized to produce local catchment-level and watershed-level
    metrics as a continuous data type (see Data Structure and Attribute Information
    for a description).",nt"license_title": null,nt"extras": [{ntt"key":
